import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './index.css';
import './LoginForm.css';
import './OrderListView.css';
import LoginForm from './LoginForm';
import OrderView from './OrderListView';
import * as serviceWorker from './serviceWorker';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.css';

////////////////////////////////////////////////////////////////////////////////////
import { applyMiddleware, createStore } from 'redux';
import thunk from 'redux-thunk';
const middleware = applyMiddleware(thunk);
import { Provider } from 'react-redux';
import userReducer from './reducers/userReducer';

const store = createStore(userReducer,null,window.devToolsExtension && window.devToolsExtension());
/////////////////////////////////////////////////////////////////////////////////////////////////

ReactDOM.render(<Provider store={store}>
    <Router>
        <div>
            <Route component={LoginForm} path="/Login" />
            <Route component={OrderView} path="/" />
            <Route component={OrderView} path="/Orders" />
        </div>
    </Router></Provider >, document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
